class FeatureExtractor:
    def extract_features(self, state: State):
        status = state.local_board_status
        board = state.board
        prev_action = state.prev_local_action if state.prev_local_action else (-1, -1)
        return np.concatenate([
            status.flatten(),
            board.flatten(),
            np.array([state.fill_num]),
            np.array(prev_action)
        ])

class DNN(nn.Module):

    def __init__(self):
        super(DNN, self).__init__()
        self.fc1 = nn.Linear(93, 256)
        self.fc2 = nn.Linear(256, 128)
        self.fc3 = nn.Linear(128, 64)
        self.fc4 = nn.Linear(64, 1)

    def forward(self, x):
        x = F.relu(self.fc1(x))
        x = F.relu(self.fc2(x))
        x = F.relu(self.fc3(x))
        x = F.tanh(self.fc4(x))
        return x

class BaselineAgent():
    def __init__(self, depth=3, timeout=2.95):
        """Instantiates your agent."""
        self.depth = depth
        self.timeout = timeout
        self.start_time = None
        self.feature_extractor = FeatureExtractor()
        self.model = DNN().eval()
        self.model.fc1.weight.data = torch.tensor(FC1_WEIGHT, dtype=torch.float32)
        self.model.fc1.bias.data = torch.tensor(FC1_BIAS, dtype=torch.float32)
        self.model.fc2.weight.data = torch.tensor(FC2_WEIGHT, dtype=torch.float32)
        self.model.fc2.bias.data = torch.tensor(FC2_BIAS, dtype=torch.float32)
        self.model.fc3.weight.data = torch.tensor(FC3_WEIGHT, dtype=torch.float32)
        self.model.fc3.bias.data = torch.tensor(FC3_BIAS, dtype=torch.float32)
        self.model.fc4.weight.data = torch.tensor(FC4_WEIGHT, dtype=torch.float32)
        self.model.fc4.bias.data = torch.tensor(FC4_BIAS, dtype=torch.float32)

    def choose_action(self, state: State) -> Action:
        """
        Returns a valid action to be played on the board.
        Assuming that you are filling in the board with number 1.

        Parameters
        ---------------
        state: The board to make a move on.
        """
        self.start_time = time.time()
        best_action = None
        curr_depth = self.depth
        is_max = True if state.fill_num == 1 else False
        while True:
            action, value = self.minimax(state, curr_depth, is_max, float("-inf"), float("inf"))
            if action is None:
                break
            best_action = action
            curr_depth += 1
        return best_action

    def minimax(
        self,
        state: State,
        depth: int,
        is_max: bool,
        alpha: float,
        beta: float
    ) -> tuple[Action, int]:
        if self.is_terminal(state, depth):
            return None, self.predict(state)
        
        actions = state.get_all_valid_actions()
        best_action = None
        if is_max:
            v = float("-inf")
            for action in actions:
                if time.time() - self.start_time > self.timeout:
                    return None, None
                new_state = state.change_state(action)
                new_v = self.minimax(new_state, depth - 1, False, alpha, beta)[1]
                if new_v is None:
                    return None, None
                if new_v > v:
                    v = new_v
                    best_action = action
                alpha = max(alpha, v)
                if v >= beta:
                    break
            return best_action, v
        else:
            v = float("inf")
            for action in actions:
                if time.time() - self.start_time > self.timeout:
                    return None, None
                new_state = state.change_state(action)
                new_v = self.minimax(new_state, depth - 1, True, alpha, beta)[1]
                if new_v is None:
                    return None, None
                if new_v < v:
                    v = new_v
                    best_action = action
                beta = min(beta, v)
                if v <= alpha:
                    break
            return best_action, v

    def is_terminal(
            self,
            state: State,
            depth: int
        ) -> bool:
        return depth <= 0 or state.is_terminal()

    def predict(self, state: State) -> float:
        if state.is_terminal():
            return state.terminal_utility() * 2 - 1
        
        with torch.no_grad():
            pred = self.model(torch.tensor(self.feature_extractor.extract_features(state), dtype=torch.float32)).item()
            return pred if state.fill_num == 1 else -pred